import { useAuth0 } from "@auth0/auth0-react";
import { useEffect } from "react";

const DeleteUser = () => {
    const {loginWithPopup} = useAuth0();
    useEffect(() => {
        fetch('http://localhost:8080/api/v1/Users/114', { method: 'DELETE' })
            .then(() => loginWithPopup());
    
    }, []);
    };

    export default DeleteUser;
